import React, { Component } from 'react'

import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';

import Join from './components/Join';
import Chat from './components/Chat';
import {SocketUser, socket} from './components/SocketUser';

//Join is login stuff

/*
  <Router>
    <Route path="/" exact component={Join} />
    <Route path="/chat" exact component={Chat} />
    <Route path="/socketuser" exact component={SocketUser} />
  </Router>
*/



class App extends Component{
  constructor(props){
    super(props);
  }

  test(){
    socket.emit('FINALLY', {msg: "OMG PLEASE"});
  }


  render(){
    return(
      <Router>
        <Switch>

          <Route path="/" />
            <Join />
          <Route path="/chat" />
            <Chat />
          <Route path="/socketuser" />
            <SocketUser />
        </Switch>
    </Router>
    )
  }

}



export default App;
